import EventItem from "./EventItem";
import classes from "./EventList.module.css";

import { useState } from "react";
import NewFight from "../pages/NewFight";

function EventList(props) {
  const [addFightForEvent, setAddFightForEvent] = useState(false);
  const [selectedEventId, setSelectedEventId] = useState("");

  console.log("Events U Event LIST", props.events);

  const ajde = () => {
    setAddFightForEvent(!addFightForEvent);
  };

  const selectEventHandler = (eventId) => {
    console.log("ide gas u spas hehe");
    console.log("Id eventa je", eventId);
    setSelectedEventId(eventId);
    setAddFightForEvent(!addFightForEvent);
  };

  return (
    <div>
      {!addFightForEvent ? (
        <ul className={classes.list}>
          {props.events.map((event) => (
            <EventItem
              key={event.id}
              id={event.id}
              name={event.name}
              selectEvent={selectEventHandler}
            />
          ))}
        </ul>
      ) : (
        <NewFight eventId={selectedEventId} />
      )}
      <button onClick={ajde}>Ajde</button>
    </div>
  );
}
export default EventList;
